import React, { useState, useEffect } from 'react';

const CollegeDetails = () => {
  const [colleges, setColleges] = useState([]);

  useEffect(() => {
    const fetchCollegeUsers = async () => {
      try {
        const response = await fetch('http://localhost:5000/api/college-users');
        if (!response.ok) {
          throw new Error(`HTTP error! Status: ${response.status}`);
        }
        const data = await response.json();
        setColleges(data);
      } catch (error) {
        console.error('Error fetching college users:', error);
      }
    };

    fetchCollegeUsers();
  }, []);

  return (
    <div>
      <h2>College Login Users</h2>
      {colleges.map((college) => (
        <div key={college._id}>
          <h3>{college.name}</h3>
          <p>College: {college.college}</p>
          <p>Uploaded Courses:</p>
          <ul>
            {college.courses.map(course => (
              <li key={course._id}>{course.title} ({course.branch})</li>
            ))}
          </ul>
        </div>
      ))}
    </div>
  );
};

export default CollegeDetails;
